import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
} from "react-router-dom";

// import Vidu from './components/Vidu';
import DashBoard from './../components/Client/Dashboard/index';

function Routerlinkk() {
  return (
    <Router>
      <div>
        <Switch>
          {/* <Route path="/addBooks" component={AddBook} />
          <Route path="/editBooks" component={EditBook} />
          <Route path="/login" component={Login} />
          <Route path="/books" component={Book} />
          <Route path="/header" component={Header} />
          <Route path="/register" component={Register} />
          <Route path="/active/:id" component={ActiveEmail} />
          // <Route path="/" component={DashBoard} /> */}
          <Route path="/" component={DashBoard} />
        </Switch>
      </div>
    </Router>
  );
}

export default Routerlinkk;
